const BCard = ({text, img}) => {
  return (
    <div>
      {text},
      {img}
    </div>
  );
};

export const WhyBDBI = (props) => {

  return (
    <div className="container">
      <h1 style={{textAlign: 'center'}}>Why BDBI?</h1>
      <div className="row">
        <BCard data = {props.data.impactCard}/>
        <BCard data = {props.data.skillCard}/>
        <BCard data = {props.data.professionalCard}/>
        <BCard data = {props.data.networkCard}/>
      </div>
      <div>
        {props.paragraph1}
      </div>
    </div>
  );
};
